import React, { Component } from 'react';
import {
   Navbar,
   Button,
   Alignment,
   Menu,
   MenuItem,
   MenuDivider,
   Popover,
   Position
} from '@blueprintjs/core';

export default class AppBar extends Component {
   render() {
      const exampleMenu = (
         <Menu>
            <MenuItem icon='user' text='Profile' />
            <MenuItem icon='cog' text='Settings' />
            <MenuItem icon='flash' text='theme' />
            <MenuItem icon='zoom-to-fit' text='fullscreen' />
            <MenuDivider />
            <MenuItem icon='cog' text='Settings...'>
               <MenuItem
                  icon='add'
                  text='Add new application'
                  disabled={true}
               />
               <MenuItem icon='remove' text='Remove application' />
            </MenuItem>
         </Menu>
      );
      return (
         <Navbar fixedToTop>
            <Navbar.Group align={Alignment.LEFT}>
               <Button minimal icon='home' text='' small />
               <Navbar.Divider />
            </Navbar.Group>
            <Navbar.Group align={Alignment.RIGHT}>
               <Popover
                  content={exampleMenu}
                  position={Position.BOTTOM}
                  minimal={true}
               >
                  <Button className='bp3-minimal' icon='user' text='' />
               </Popover>
            </Navbar.Group>
         </Navbar>
      );
   }
}
